    }

    useEffect(() => {
        console.log(name)
    }, [name])

    return(
        <div>
            <label htmlFor="name">name</label>
            <input type="text" id="name" placeholder="이름을 입력하세요" value={name} onChange={onChangeName}/>
        </div>
    )
}

